function updateProjectList(n){try{$("#div_result_loader").html("");$.ajax({url:n,type:"GET",cache:!1,headers:{"Cache-Control":"max-age=3600"},success:function(n,t){t=="success"&&($("#div_result_loader").html(n),$("img").unveil(250))},error:function(n,t,i){$("#div_result_loader").html("<br/><h3>No Result Found<\/h3><br/>");console.log(n,i)}})}catch(t){$("#div_result_loader").html("<br/><h3>No Result Found<\/h3><br/>");console.log(t)}}String.prototype.format=function(){var n=[].slice.call(arguments);return this.replace(/(\{\d+\})/g,function(t){return n[+t.substr(1,t.length-2)||0]})};